import { flexbox } from "@material-ui/system";


export default theme => {
    return {
      card: {
        maxWidth: 345
      },
      media: {
        height: 0,
        paddingTop: "56.25%" // 16:9
      },
      cardHeader: {
        backgroundColor: "#4a8ac8",
        fontSize: "8px"
      },
      price: {
        fontWeight: 900
      },
      addBtn: {
        color: "#4a8ac8"
      },
      actionItems: {
        justifyContent: "space-between",
        padding: "16px"
      },
      buttonGroup: {
        display: "flex",
        justifyContent: "column"
      }
    };
  };
